import ExpenseItem from "./ExpenseItem";

function Expense(props) {
const expenses = props.items;

  return (
    <div>
      {expenses.map((expense) => {
        return (
          <ExpenseItem
            title={expense.title}
            amount={expense.amount}
            date={expense.date}
          />
        );
      })}
    </div>
  );
}

export default Expense;
